import React, { useState } from 'react';
import GroceryList from './GroceryList';
import Car from './Car';

function App() {
  const [lab, setLab] = useState('');

  const groceries = ['Rice', 'Wheat', 'Sugar', 'Milk', 'Oil'];

  return (
    <div className="App">
      <h1>React Labs Project</h1>

      {/* Buttons for each lab */}
      <button onClick={() => setLab('lab1')}>Show Lab 1 - GroceryList</button>
      <button onClick={() => setLab('lab2')}>Show Lab 2 - Car</button>
      <br /><br />

      {/* Render based on selected lab */}
      {lab === 'lab1' && <GroceryList items={groceries} />}
      {lab === 'lab2' && (
        <Car brand="Toyota" model="Fortuner" color="Black" year="2022" />
      )}
    </div>
  );
}

export default App;
